    def CreateBitmap(self, artid, client=wx.ART_OTHER, size=wx.DefaultSize):
        if client in [wx.ART_MENU, wx.ART_FRAME_ICON, wx.ART_CMN_DIALOG]:
            return self._icons16.get(artid, wx.NullBitmap)
        elif client in [wx.ART_TOOLBAR, wx.ART_BUTTON, wx.ART_MESSAGE_BOX]:
            return self._icons22.get(artid, wx.NullBitmap)
        else:
            return self._icons32.get(artid, wx.NullBitmap)
